import './App.css';
// Router
import AppRouter from './Router/AppRouter';
// Components Imports
import HomePage from './components/HomePage'
import NavBar from './components/NavBar';
import Projects from './components/Projects';
import AboutMePage from './Pages/AboutMePage';

// Images
  // First project images and link
import CNNup from '../src/assets/CNN-UpRight.png';
import CNNlaying from '../src/assets/CNN-LayDown.png';
import CNNpdf from '../src/Documents/CNN_Proposal.pdf';


function App() {

  // const [projects, setProjects] = useState([
  //   { },
  //   {},
  //   {}
  // ]);

  // first project array
  const firstProjectTags = ["React.js", "HTML", "CSS", "JavaScript"];

  return (
    <div>
        <NavBar />
        <HomePage />
        <Projects 
          projectTitle="Convolutional Neural Network"
          projectFrom="University Course Work"
          projectInfo="Paper proposing possible way to use CNN to identifying structural damage within reinforced concrete using Radiographs, also known as X-rays"
          projectTags={firstProjectTags}
          srcImageOne={CNNup}
          srcImageTwo={CNNlaying}
          linkToProject={CNNpdf}
        />
        {/* <Projects /> */}

        <AboutMePage/>

    </div>
  );
}

export default App;
